import './NavbarStyles.css'
import React from "react";
import { Link } from 'react-router-dom';
import { FaTimes } from "react-icons/fa";
import { useState } from 'react';

const Navbar = () => {

    const [click, setClick] = useState(false);

    const handleClick = ()=>{
        setClick(!click)

    }
  return (

    <React.Fragment> 
            <nav className="navbar navbar-expand-lg navbarScroll bg-body-tertiary">
  <div className="container-fluid fw-bold">

    <Link to='/' className="navbar-brand">Portfolio</Link>
    <button  onClick={handleClick} className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" >

      {
        click ? (<FaTimes className="close" size={20}></FaTimes>) : (<span className="navbar-toggler-icon"></span>)
      }
    </button>


    <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
      <div className="navbar-nav ms-auto">
        <Link to='/' className="nav-link active" aria-current="page">Home</Link> 
        <Link to='/project' className="nav-link">Project</Link> 
        <Link to='/about' className="nav-link">About</Link> 
        <Link to='/contact' className="nav-link">Contact</Link> 
      </div>
    </div>
  </div>
</nav>
</React.Fragment>

  )
};

export default Navbar;
